import React from 'react';
import { Link } from 'react-router-dom';

function App() {
  return (
    <React.Fragment className="App">
      <nav class="navbar navbar-light bg-light">
        <Link class="navbar-brand" href="#">
          <div className="logo">SmartCode</div>
        </Link>
      </nav>
    </React.Fragment>
  );
}

export default App;
